import React, { useState } from 'react';
import { Modal } from '@consta/uikit/Modal';
import { TextField } from '@consta/uikit/TextField';
import { Button } from '@consta/uikit/Button';
import { Grid, GridItem } from '@consta/uikit/Grid';
import { Select } from '@consta/uikit/Select';

type AddCustomerModalProps = {
  isOpen: boolean;
  onClose: () => void;
};

const customerTypeOptions = [
  { label: 'Юридическое лицо', value: 'organization' },
  { label: 'Физическое лицо', value: 'person' },
];

const AddCustomerModal: React.FC<AddCustomerModalProps> = ({
  isOpen,
  onClose,
}) => {
  const [customerCode, setCustomerCode] = useState<string>('');
  const [customerName, setCustomerName] = useState<string>('');
  const [customerINN, setCustomerINN] = useState<string>('');
  const [customerKPP, setCustomerKPP] = useState<string>('');
  const [customerLegalAddress, setCustomerLegalAddress] = useState<string>('');
  const [customerPostalAddress, setCustomerPostalAddress] =
    useState<string>('');
  const [customerEmail, setCustomerEmail] = useState<string>('');
  const [customerCodeMain, setCustomerCodeMain] = useState<string>('');
  const [customerType, setCustomerType] = useState<'organization' | 'person'>(
    'organization'
  );

  const handleAddClient = () => {
    const newCustomer = {
      customer_code: customerCode,
      customer_name: customerName,
      customer_inn: customerINN,
      customer_kpp: customerKPP,
      customer_legal_address: customerLegalAddress,
      customer_postal_address: customerPostalAddress,
      customer_email: customerEmail,
      customer_code_main: customerCodeMain,
      is_organization: customerType === 'organization',
      is_person: customerType === 'person',
    };
    console.log('New Customer:', newCustomer);
    onClose();
  };

  return (
    <Modal isOpen={isOpen} onClose={onClose} style={{ maxWidth: '800px' }}>
      <div style={{ padding: '20px' }}>
        <h3>Добавить нового клиента</h3>
        <Grid cols={3} gap="m">
          <GridItem>
            <TextField
              label="Код контрагента"
              value={customerCode}
              onChange={({ value }) => setCustomerCode(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Наименование"
              value={customerName}
              onChange={({ value }) => setCustomerName(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="ИНН"
              value={customerINN}
              onChange={({ value }) => setCustomerINN(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="КПП"
              value={customerKPP}
              onChange={({ value }) => setCustomerKPP(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Юридический адрес"
              value={customerLegalAddress}
              onChange={({ value }) => setCustomerLegalAddress(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Почтовый адрес"
              value={customerPostalAddress}
              onChange={({ value }) => setCustomerPostalAddress(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Электронная почта"
              value={customerEmail}
              onChange={({ value }) => setCustomerEmail(value)}
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Вышестоящий контрагент"
              placeholder="Код вышестоящего контрагента"
              value={customerCodeMain}
              onChange={({ value }) => setCustomerCodeMain(value)}
            />
          </GridItem>
          <GridItem>
            <Select
              label="Тип лица"
              placeholder="Выберите тип"
              items={customerTypeOptions}
              onChange={({ value }) =>
                setCustomerType(value as 'organization' | 'person')
              }
            />
          </GridItem>
          <GridItem>
            <div style={{ display: 'flex', justifyContent: 'space-between' }}>
              <Button label="Добавить" onClick={handleAddClient} />
              <Button label="Отмена" onClick={onClose} />
            </div>
          </GridItem>
        </Grid>
      </div>
    </Modal>
  );
};

export default AddCustomerModal;
